CREATE DEFINER=`root`@`localhost` PROCEDURE `spGetResults`(IN this_problem_id BIGINT(20))
BEGIN
	SELECT results.participant_id, results.mst_dist, results.exec_time, results.`timestamp`, results.problem_id FROM results 
    INNER JOIN (SELECT results.participant_id, MIN(results.mst_dist) as score FROM results WHERE results.problem_id = this_problem_id GROUP BY (participant_id) ORDER BY results.`timestamp`) b
    ON results.participant_id = b.participant_id AND results.mst_dist = b.score  WHERE results.problem_id = this_problem_id
    ORDER BY b.score ASC, results.`timestamp` ASC;
END ;;
